INSERT INTO cms_einstelungen_archenoah VALUES
(1, 'isconet.de', 'info@isconet.de', 'DB_HAH_00001', '1200', NULL, 5, NULL, NULL, 'smtp.strato.de', 'a.kaceri@isconet.de', 'cane1986', '25', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10, '1', 'Isconet', 'Kaceri', 'ASan', 'as', 'asd', 'asd', 'asd', 'a.kaceri@isconet.de', NULL, '30', '5', 12, 'a.kaceri@isconet.de', NULL, 1, 5, 1, 1, 1, 1, '<h2 style="text-align: center;"><strong><span style="font-size:18px"><span style="font-family:arial,helvetica,sans-serif">Release Info</span></span></strong></h2>\r\n\r\n<hr />\r\n<p style="margin-left: 40px;"><em><u><span style="font-size:14px"><span style="font-size:16px">Archenoah 0.1</span></span></u></em></p>\r\n\r\n<ul>\r\n\t<li style="margin-left: 40px;"><span style="font-size:14px"><span style="font-size:16px">Benutzerverwaltung</span></span></li>\r\n\t<li style="margin-left: 40px;"><span style="font-size:14px"><span style="font-size:16px">Gruppenverwaltung</span></span></li>\r\n\t<li style="margin-left: 40px;"><span style="font-size:14px"><span style="font-size:16px">Berrechtigungsverwatung</span></span></li>\r\n\t<li style="margin-left: 40px;"><span style="font-size:14px"><span style="font-size:16px">Layout Metrodesign</span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 1, 'a.kaceri@isconet.de', 'Health Care at Home Data entry Application', 'company-logo', 'superbar-taskbar isconet-logo');
INSERT INTO cms_email_liste_vorlage VALUES
(1, 'Benutzer Erstellen Email Vorlage', 'Vorlage Dient für das Senden des Passwort für die Benutzerverwaltung', '<p>Sehr geehrte/er&nbsp; #Anrede#&nbsp; #Name#&nbsp; #Vorname# ,<br />\nhiermit schicke ich Ihnen die Angeforderten Zugangsdaten.<br />\n<br />\nBenutzername :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="color:#00FF00;"> #Username#</span><br />\nPasswort:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; #Passwort#<br />\n<br />\nBitte melden Sie sich unter&nbsp; #webiste# und &auml;ndern Sie schnellst m&ouml;glich das<br />\n<br />\nHinweis: Diese Email wurde Automatisch Generiert.</p>\n', 2),
(7, 'Email Senden Protokolle', '', 'Sehr geehrte Damen und Herren,<br><br><font color="blue">#Nurse#</font> hat ihnen das Protokoll(<font color="blue">#Protokolle#</font>) von den Patienten <font color="blue">#Patient#</font> zur Bearbeitung Freigegeben.<br><br>Datum von: <font color="blue">#Dat_von#</font><br>Datum&nbsp; bis: <font color="blue">#Dat_bis#</font><br><br>MFG HAH Application<br>', 2),
(6, 'Email Senden an Nurse', 'Vorlage für Zuweisung ', 'Sehr geehrte/er&nbsp;<font color="blue"> #Nurse#</font> ,<br>ihnen wurde der Patient <font color="blue">#Patient#</font> Zugewiesen.<br>Sie sollen in ihn dem Medikament <font color="blue">#Projektname#</font> Schulen.<br>Sie sind die <font color="blue">#Status#</font>.<br><br>Bei weiteren Fragen stehen wir ihnen jederzeit zur verfügung.<br><br>Tel. 0621701196<br><br>MFG <br><br>Customer Service Team<br><br>************ Achtung Generierte Email bitte nicht Antworten ************<br><br><br>', 2);
