INSERT INTO cms_language_validator_list VALUES
(1, 1, 'package archenoah.lib.vaadin.Components.Validators.Validatoren;\r\n\r\nimport javax.validation.constraints.*;\r\nimport org.hibernate.validator.constraints.Email;\r\nimport org.hibernate.validator.constraints.Length;\r\nimport org.hibernate.validator.constraints.Length.List;\r\nimport org.hibernate.validator.constraints.NotEmpty;\r\nimport java.util.Date;\r\n\r\npublic class DEU_Setup_Willkommen_1 {\r\n\r\n\t\r\n\tString Keine_Validierung;\r\n\t\r\n\t@List({\r\n\t    @Length(min = 3, message = "Die Postleitzahl muss mindestens 3 Zahlen erhalten"),\r\n\t    @Length(max = 10, message = "Die Postleitzahl darf höchstens 10 Zahlen erhalten"),\r\n\t})\r\n\t@Pattern(regexp="[0-9]*", message="Sie dürfen nur Zahlen 0-9 verwenden")\r\n\t\r\n\tString PLZ;\r\n\t\r\n\t\r\n\r\n\tString Ort;\r\n\t\r\n\t\r\n\t@List({\r\n\t    @Length(min = 5, message = "Die Telefonnummer muss mindestens 5 Zeichen erhalten"),\r\n\t    @Length(max = 15, message = "Die Telefonnummer darf höchstens 15 Zeichen erhalten"),\r\n\t})\r\n\t@Pattern(regexp="[0-9]*", message="Sie dürfen nur Zahlen 0-9 verwenden")\r\n\t\r\n\tString Tel;\r\n\t\r\n\t\r\n\t@Size(max = 50 ,message = "Ihre Zeichenkette ist zu lang!")\r\n\t@Email\r\n\tString Email;\r\n\r\n}', '1', 1),
(2, 2, 'package archenoah.lib.vaadin.Components.Validators.Validatoren;\r\n\r\n\r\nimport org.hibernate.validator.constraints.Length;\r\nimport org.hibernate.validator.constraints.Length.List;\r\nimport javax.validation.constraints.AssertTrue;\r\n\r\npublic class DEU_Login_Passwort_Ändern_1 {\r\n\r\n\t@List({\r\n\t    @Length(min = 5, message = "Das Passwort muss mindestens 5 Zeichen erhalten"),\r\n\t    @Length(max = 15, message = "Das Passwort darf höchstens 20 Zeichen erhalten"),\r\n\t})\r\n\t\r\n\tString Passwort;\r\n\t\r\n\t\t@List({\r\n\t    @Length(min = 5, message = "Das Passwort muss mindestens 5 Zeichen erhalten"),\r\n\t    @Length(max = 15, message = "Das Passwort darf höchstens 20 Zeichen erhalten"),\r\n\t\t})\r\n\t  \r\n\tString  Passwort2;\r\n\t\r\n\t\r\n\t\r\n\t\r\n}', '1', 1),
(3, 7, 'package archenoah.lib.vaadin.Components.Validators.Validatoren;\r\n\r\n\r\nimport org.hibernate.validator.constraints.Length;\r\nimport org.hibernate.validator.constraints.Length.List;\r\nimport javax.validation.constraints.AssertTrue;\r\n\r\npublic class DEU_Benutzer_Insert_Edit_1 {\r\n\r\n\t@Size(max = 50 ,message = "Ihre Zeichenkette ist zu lang!")\r\n\t@Email\r\n\tString email;\r\n\t\r\n\t@List({\r\n\t    @Length(min = 5, message = "Die Telefonnummer muss mindestens 5 Zeichen erhalten"),\r\n\t    @Length(max = 15, message = "Die Telefonnummer darf höchstens 15 Zeichen erhalten"),\r\n\t})\r\n\t@Pattern(regexp="[0-9]*", message="Sie dürfen nur Zahlen 0-9 verwenden")\r\n\tString  tel;\r\n\t\r\n\t\r\n\t\r\n\tString No_Val;\r\n\t\r\n\t\r\n\t\r\n\t\r\n}', '1', 1);
